import { Link } from "react-router-dom";


function Favoritos() {
    const [Filme, setFilme] = useState({})



    useEffect(() => {
        async function loadfavoritos() {
            const response = await localStorage.getItem("@FilmesFavoritos")
            setFilme(JSON.parse(Filme))
        }
        loadfavoritos()
    }, [Filme])

    console.log(Filme)

    return (
        <div>
            <p>
                {Filme.title}
            </p>
        </div>
    )
}

